def normalize_matrix(matrix):
  """
  Normalizes a Pandas matrix to values between 0 and 1.

  enter:
    receives a Pandas matrix.

  Returns:
    A Pandas matrix with values normalized between 0 and 1.
  """
  return (matrix - matrix.min()) / (matrix.max() - matrix.min())


dfNormal = normalize_matrix(dfFinal)
dfNormal.head()

X = dfFinal.iloc[:,0:16].to_numpy()#data
